const cardList = document.querySelector('.cardList');

//  url  
const makeImgTag = (img) => `<img src="${img}" alt="" />`;

// email @   
const makeEmailTag = (email) => {
  const userEmail = email.split('@')[0];
  return `
    <div class="email">${userEmail}</div>
    `;
};

const makeSsnTag = (ssn) => `<div class="ssn">${ssn}</div>`;

//   4 ****  
const makeCardTag = (card) => {
  const makedCard = [...card].map((v, i) => (i < 4 ? '*' : v)).join('');
  return `
    <div class="cardNumber">${makedCard}</div>
    `;
};

data.forEach((v) => {
  cardList.insertAdjacentHTML(
    'beforeend',
    `
    <div class="card">
    <div class="cardImage">
      ${makeImgTag(v.imageURL)}
    </div>
    <div class="info">
      ${makeEmailTag(v.email)}
      ${makeSsnTag(v.ssn)}
      ${makeCardTag(v.card)}
    </div>
  </div>
    
    `
  );
});
